import React , {Component} from "react";
import '../style.css';
import '../style1.css';


  class Ul extends Component{ 
    //البناء
constructor(){
super()

this.state = {
    pageNamer: [] ,

    }
    
}







 //الكتابه

render(){
    const {Citieslength , notesonpaeg}=this.props
    for (var a = 1 ; a <= Citieslength / notesonpaeg  ; a++ ){
    this.state.pageNamer.push(<li id="pagintion-li" key={a}>{a}</li>)

    }
   
    
    
return(
        <div>
        <ul id="pagintion-ul">
            {this.state.pageNamer}
        </ul>
        </div>
    )}
}
export default Ul;
